DROP VIEW IF EXISTS `papers_name`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `papers_name` AS select `paper_types`.`name_type` AS `name_type`,`manufacturers`.`name_manufacturer` AS `name_manufacturer`,`materials`.`material_name` AS `material_name`,`papers`.`paper_name` AS `paper_name` from (((`manufacturers` join `papers` on(`manufacturers`.`id_manufacturer` = `papers`.`manufacturer`)) join `materials` on(`materials`.`id_material` = `papers`.`material`)) join `paper_types` on(`paper_types`.`id_type` = `papers`.`type`)) WITH CASCADED CHECK OPTION;

